import styled from "styled-components";

export const ContainerCard = styled.div`
    display: flex;
    gap: 10px;
    flex-wrap: wrap;
    justify-content: center;
`

export const Container = styled.div`
    min-height: 100vh;
    background-color: #1C1C1C;
`

export const Title = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    color: white;
    height: 10vh;
    font-size: 2rem;

`
